import React, { Component, Fragment } from 'react'
import { Route, Redirect  } from 'react-router-dom'

import Welcome from '../Welcome'
import Login from '../Login'
import Register_Owner from '../Register_Owner'
import Register_Pet from '../Register_Pet'
import Home from '../Home'
import EditOwner from '../EditOwner'
import EditPet from '../EditPet'
import Visit from '../Visit'
// import VisitOwner from '../Visit_Owner'
import Appointments from '../Appointments';

import './index.sass'
import logic from '../../logic';

//testejar el helper, cors....

class App extends Component {
  
    state={isLoggedIn: logic.isUserLoggedIn, isAdmin: logic.isAdmin}
   
    render() {

        const {state: {isLoggedIn, isAdmin}} = this

        return <Fragment>
                <Route exact path='/' component={Welcome}/>
                <Route path='/login' component={Login}/>
                <Route path='/registerOwner' component={Register_Owner}/>
                <Route path='/registerPet' component={Register_Pet}/>
                {/* <Route path='/editOwner' component={EditOwner}/> */}

                <Route path='/editOwner' render={()=> isAdmin? <EditOwner /> : <Redirect to='/' /> }/>
                <Route path='/editPet' component={EditPet}/>
                <Route path='/visit' component={Visit}/>
                <Route path='/appointments' component={Appointments}/>
                {/* <Route path='/visitOwner' component={VisitOwner}/> */}

                <Route path= '/home' component={Home}/>
            </Fragment>    
    }
}

export default App
